/**
Implement wildcard pattern matching with support for '?' and '*'.

'?' Matches any single character.
'*' Matches any sequence of characters (including the empty sequence).

The matching should cover the entire input string (not partial).

The function prototype should be:
bool isMatch(const char *s, const char *p)

Some examples:
isMatch("aa","a") → false
isMatch("aa","aa") → true
isMatch("aaa","aa") → false
isMatch("aa", "*") → true
isMatch("aa", "a*") → true
isMatch("ab", "?*") → true
isMatch("aab", "c*a*b") → false
*/
#include <iostream>
#include <string>
#include <unordered_map>
#include <vector>

using namespace std;

using remember_t = unordered_map<int, unordered_map<int, bool>>;

class Solution {
public:
    bool isMatch(string s, string p) {
        remember_t remember;
        p = move(simplify(p));
        int begin = 0, end = 0;
        /**
         * Matching beginning and ending stop when find *
         */
        while (begin<s.length() && begin<p.length()) {
            if (p[begin] == '*') {
                break;
            }
            if (p[begin] == '?' || p[begin] == s[begin]) {
                ++begin;
            } else {
                return false;
            }
        }
        while (s.length()-end-1 > begin && p.length()-end-1 > begin) {
            if (p[p.length()-end-1] == '*') {
                break;
            }
            if (p[p.length()-end-1] == '?' || p[p.length()-end-1] == s[s.length()-end-1]) {
                ++end;
            } else {
                return false;
            }
        }
        p = move(p.substr(begin, p.length()-begin-end));
        /**
         * Calculate non '*' in pattern to reduce recursive
         */
        vector<int> non_star(p.length(), 0);
        if (p.length() > 0) {
            non_star[p.length() - 1] = p[p.length()-1] == '*' ? 0 : 1;
        }
        int plen = p.length();
        for (int i=plen-2; i>=0; --i) {
            non_star[i] = p[i] == '*' ? non_star[i+1] : non_star[i+1] + 1;
        }
        return doIsMatch(s.substr(begin, s.length()-end-begin), p, 0, 0, remember, non_star);
    }

private:
    bool doIsMatch(const string &s, const string &p,
            int sbegin, int pbegin, remember_t &remember, const vector<int> &non_star) {
        //cout << sbegin << ' ' << pbegin << endl;
        auto it1 = remember.find(pbegin);
        if (it1 != remember.end()) {
            auto it2 = it1->second.find(sbegin);
            if (it2 != it1->second.end()) {
                return it2->second;
            }
        }
        int plen = p.length();
        int slen = s.length();
        if (pbegin >= plen && sbegin >= slen) {
            return remember[pbegin][sbegin] = true;
        }
        if (pbegin >= plen) {
            return remember[pbegin][sbegin] = false;
        }
        int ori_sbegin = sbegin, ori_pbegin = pbegin;
        while (pbegin < plen && sbegin < slen) {
            if (p[pbegin] == '?') {
                ++pbegin;
                ++sbegin;
                continue;
            }
            if (p[pbegin] != '*') {
                if (s[sbegin] != p[pbegin]) {
                    return remember[ori_pbegin][ori_sbegin] = false;
                }
                ++pbegin;
                ++sbegin;
                continue;
            }
            if (p[pbegin] == '*') {
                if (pbegin + 1 == p.length()) {
                    return remember[ori_pbegin][ori_sbegin] = true;
                }
                for (int i=sbegin; i<slen && i<=slen-non_star[pbegin+1]; ++i) {
                    if (doIsMatch(s, p, i, pbegin+1, remember, non_star)) {
                        return remember[ori_pbegin][ori_sbegin] = true;
                    }
                }
                return remember[ori_pbegin][ori_sbegin] = false;
            }
        }
        if (pbegin + 1 == plen && p[pbegin] == '*') {
            return remember[ori_pbegin][ori_sbegin] = true;
        }
        return remember[ori_pbegin][ori_sbegin] = (pbegin == plen && sbegin == slen);
    }

    /**
     * Remove continuous *
     */
    inline string simplify(const string &s) {
        string result;
        char prev = 0;
        for (int i=0; i<s.length(); ++i) {
            if (s[i] == '*' && prev!='*') {
                prev = '*';
                result.push_back(s[i]);
            } else if (s[i] != '*') {
                prev = s[i];
                result.push_back(s[i]);
            }
        }
        return result;
    }
};

int main()
{
    Solution s;
    cout << s.isMatch("abbaabbbbababaababababbabbbaaaabbbbaaabbbabaabbbbbabbbbabbabbaaabaaaabbbbbbaaabbabbbbababbbaaabbabbabb", "***b**a*a*b***b*a*b*bbb**baa*bba**b**bb***b*a*aab*a**") << endl;
    cout << s.isMatch("", "**") << endl;
    cout << s.isMatch("bababbbbabaabbabbabbabbabbbaabbbabbbababaabbbbaabababaababbabbbbabaaaabaaaaabaabaabaabbabaaababbbbabbbbbabbbaaaaabaabbbaababbbbaabbbabaaaaaaaabaababbbbbbbaaabbaaabbbbbabbababbabababababbbbbabbaaaabaab", "b*a*aabb**bb*aa*b*a*bb*bb*b*ab**a*ba**bab**a****ba**ba***b***ab****bb*b*b***b****baaba**bb**b****aa*a**") << endl;
    cout << s.isMatch("a", "aa") << endl;
    return 0;
}
